class MakeUpTable extends StatefulWidget {
  @override
  _MakeUpTableState createState() => _MakeUpTableState();
}

class _MakeUpTableState extends State<MakeUpTable> {
  int count = 0;
  DatabaseHelper dbHelper = DatabaseHelper.instance;
  bool expanded = false;

  static const TextStyle labelStyle2 = TextStyle(
    fontFamily: 'Sitka Text',
    fontSize: 14,
    color: Color(0xff000000),
    fontStyle: FontStyle.italic,
    fontWeight: FontWeight.bold,
    shadows: [
      Shadow(
        color: Color(0x29000000),
        offset: Offset(0, 3),
        blurRadius: 4,
      )
    ],
  );

  Future<List<Products>> loadProducts() async {
    var allRows = await dbHelper.queryAllRows();
    List<Products> allProducts = [];
    for (var row in allRows) {
      allProducts.add(Products.fromMap(row));
    }
    return allProducts;
  }

  @override
  Widget build(BuildContext context) {
    return FutureBuilder<List<Products>>(
        future: loadProducts(),
        builder:
            (BuildContext context, AsyncSnapshot<List<Products>> snapshot) {
          List<Products> dizhuang = [];
          List<Products> zhexia = [];
          List<Products> caizhuang = [];
          List<Products>? allProducts = snapshot.data;
          if (allProducts != null) {
            for (Products product in allProducts) {
              if (product.productStyle == '底妆') {
                dizhuang.add(product);
              } else if (product.productStyle == '遮瑕和修容') {
                zhexia.add(product);
              } else if (product.productStyle == '彩妆') {
                caizhuang.add(product);
              }
            }
          }

          return Scaffold(
              backgroundColor: const Color(0xffEDF2F2),
              floatingActionButton: FloatingActionButton(
                onPressed: () async {
                  final bool? shouldRefresh = await Navigator.of(context).push(
                      MaterialPageRoute(
                          builder: (context) => ProductAddPage(
                              products: Products(
                                  null,
                                  null,
                                  null,
                                  null,
                                  DateTime.now(),
                                  DateTime.now(),
                                  DateTime.now(),
                                  null))));
                  print(shouldRefresh);
                  if (shouldRefresh != null) {
                    setState(() {
                      loadProducts();
                    });
                  }
                },
                child: AddMakeUpButton(),
              ),
              floatingActionButtonLocation:
                  FloatingActionButtonLocation.centerFloat,
              body: Center(
                child: Stack(
                  children: [
                    BackGroundWidget(),
                    Column(
                      mainAxisSize: MainAxisSize.max,
                      mainAxisAlignment: MainAxisAlignment.start,
                      children: <Widget>[
                        // 产品柜标题
                        SizedBox(
                            height: 100,
                            child: Align(
                              alignment: Alignment.bottomCenter,
                              child: PageLink(
                                links: [
                                  PageLinkInfo(
                                    transition: LinkTransition.Fade,
                                    ease: Curves.easeOut,
                                    duration: 0.3,
                                    pageBuilder: () => ProductAddPage(
                                        products: Products(
                                            null,
                                            null,
                                            null,
                                            null,
                                            DateTime.now(),
                                            DateTime.now(),
                                            DateTime.now(),
                                            null)),
                                  ),
                                ],
                                child: const Text(
                                  '产品柜',
                                  style: TextStyle(
                                    fontFamily: 'Microsoft Yi Baiti',
                                    fontSize: 35,
                                    color: Color(0xff06241a),
                                    height: 0.5714285714285714,
                                    shadows: [
                                      Shadow(
                                        color: Color(0x29000000),
                                        offset: Offset(0, 3),
                                        blurRadius: 6,
                                      )
                                    ],
                                  ),
                                  textHeightBehavior: TextHeightBehavior(
                                      applyHeightToFirstAscent: false),
                                  textAlign: TextAlign.center,
                                ),
                              ),
                            )),
                        // 标题-产品柜分割线
                        const Divider(
                          color: Color.fromARGB(255, 84, 82, 82),
                        ),
                        Container(
                          width: double.infinity,
                          decoration: BoxDecoration(
                            color: const Color(0xffffffff).withOpacity(0.48),
                            borderRadius: BorderRadius.circular(24.0),
                            boxShadow: const [
                              BoxShadow(
                                color: Color(0x29000000),
                                offset: Offset(0, 3),
                                blurRadius: 6,
                              ),
                            ],
                          ),
                          child: Column(children: <Widget>[
                            // 底妆
                            SubTitle(subTitle: '底妆'),
                            Shelf(products: dizhuang),
                            const Divider(
                              color: Color.fromARGB(255, 84, 82, 82),
                            ),
                            // 遮瑕和修容
                            SubTitle(subTitle: '遮瑕和修容'),
                            Shelf(products: zhexia),
                            const Divider(
                              color: Color.fromARGB(255, 84, 82, 82),
                            ),
                            // 彩妆
                            SubTitle(subTitle: '彩妆'),
                            Shelf(products: caizhuang),
                          ]),
                        ),
                        const Divider(
                          color: Color.fromARGB(255, 84, 82, 82),
                        ),
                      ],
                    ),
                  ],
                ),
              ));
        });
  }
}

