class ProductInfoButton extends StatelessWidget {
  const ProductInfoButton(this.productInfo);
  final Products productInfo;
  @override
  Widget build(BuildContext context) {
    return InkWell(
      onTap: () {
        Navigator.push(
            context,
            MaterialPageRoute(
                builder: (context) => ProductAddPage(
                      products: productInfo,
                    )));
      },
      child: Container(
        width: 39,
        height: 39,
        decoration: BoxDecoration(
          image: DecorationImage(
            image: Image.file(File(productInfo.image!)).image,
            fit: BoxFit.cover,
          ),
          // borderRadius: BorderRadius.circular(21.0),
          shape: BoxShape.circle,
          boxShadow: const [
            BoxShadow(
              color: Color(0x29000000),
              offset: Offset(0, 3),
              blurRadius: 6,
            ),
          ],
        ),
      ),
    );
  }
}

class Shelf extends StatefulWidget {
  const Shelf({Key? key, required this.products}) : super(key: key);
  final List<Products> products;

  @override
  _ShelfState createState() => _ShelfState();
}

class _ShelfState extends State<Shelf> {
  bool expanded = false;

  @override
  Widget build(BuildContext context) {
    return Column(
      children: [
        SizedBox(
          width: 370,
          child: Row(children: [
            expanded
                ? SizedBox(
                    width: 293.5,
                    height: 50,
                    child: ListView.separated(
                      scrollDirection: Axis.horizontal,
                      itemCount: widget.products.length,
                      itemBuilder: (context, index) =>
                          ProductInfoButton(widget.products[index]),
                      separatorBuilder: (context, index) {
                        return const SizedBox(
                          width: 5,
                        );
                      },
                    ))
                : SizedBox(
                    width: 293.5,
                    child: Wrap(
                      alignment: WrapAlignment.start,
                      spacing: 5.0,
                      runSpacing: 10.0,
                      children: List.generate(widget.products.length,
                          (index) => ProductInfoButton(widget.products[index])),
                    )),
            Container(
              color: Colors.white,
              width: 10,
            ),
            IconButton(
              alignment: Alignment.topCenter,
              icon: expanded
                  ? const Icon(Icons.expand_less)
                  : const Icon(Icons.more_horiz),
              onPressed: () {
                setState(() {
                  expanded = !expanded;
                });
              },
            ),
          ]),
        ),
        SvgPicture.string(
          _svg_lfrjy3,
          allowDrawingOutsideViewBox: true,
          fit: BoxFit.fill,
        ),
        const SizedBox(
          height: 2,
        ),
        Container(
          height: 16.3,
          width: 351.5,
          decoration: const BoxDecoration(
            color: Color(0xffffffff),
            borderRadius: BorderRadius.only(
              topLeft: Radius.circular(2.0),
              topRight: Radius.circular(2.0),
              bottomRight: const Radius.circular(10.0),
              bottomLeft: Radius.circular(10.0),
            ),
            boxShadow: [
              BoxShadow(
                color: Color(0x29000000),
                offset: Offset(0, 6),
                blurRadius: 6,
              ),
            ],
          ),
        ),
      ],
    );
  }
}

